import React from "react";
import logo from "./logo.png";
function Header() {
  return (
    <div style={{ paddingLeft: "150px", paddingRight: "20px" }}>
      <nav style={{ backgroundColor: "#FFCCCC", height: "85px" }}>
        <img src={logo} style={{ width: "100px", height: "80px" }} />
        <a style={{ marginLeft: "800px" }} href="/">
          Home
        </a>
        <a style={{ marginLeft: "80px" }} href="/dishes">
          Reciepe
        </a>
        <a style={{ marginLeft: "80px" }} href="/about">
          About
        </a>
      </nav>
    </div>
  );
}
export default Header;
